import styles from './Nav.module.css'

export function Nav() {
  return (
    <nav>
        <div className={styles.content}>
            <a href="#" className={styles.scrollButton}>Work</a>
            <a href="#" className={styles.scrollButton}>Posts</a>
            <a href="#" className={styles.scrollButton}>Contact</a>
        </div>
    </nav>
  );
}
